import logo from './logo.svg';
import iphone from './ressources/iphonex.png';
import nature from './ressources/nature.jpg';

function Product(){
    return(

        <div class="card w-75">
            <div class="card-header">
                <h6 class="d-inline">6000 kr - </h6>
                <small class="d-inline text-muted">Bergen</small>             
            </div>
                <img src={iphone} class="card-img-top" alt="alt-image-cap" id="product-photo"/>
            <div class="card-body">
                <p class="card-text mb-3">Pent brukt Iphone X. Kjopt in 2019. Ny pris: 2345 kr. Ma hentes her.</p>
                <div class="text-center">
                <button class="btn btn-primary text-center">Send Message</button>
                </div>
            </div>
        </div>

    
    );
}

export default Product;
